import React from 'react';
import AllRoutes from './Routes/AllRoutes'; // Ensure this path is correct
import Navbar from './components/Navbar'; // Example Navbar component
import Sidebar from './components/Sidebar'; // Example Sidebar component
import { ChakraProvider } from '@chakra-ui/react'; // Assuming you are using Chakra UI

function App() {
  return (
    <ChakraProvider>
      <Navbar />
      <Sidebar />
      <div>
        <AllRoutes />
      </div>
    </ChakraProvider>
  );
}

export default App;
